import React from 'react';
import ReactDOM from 'react-dom';
// import ComA from './ComA'
// import ToDoLists from './ToDoLists';
import App from './App';
import './index.css';
import {BrowserRouter} from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
  <App/>
  </BrowserRouter>,
  document.getElementById('root')
);
